import Head from 'next/head'
import MainLAyout from '../components/Mainlayout'

export default function Home() {
  return (
    <MainLAyout>
      <Head>
        
      </Head>

      <main>
<form className="bookingsContainer">
      <div className="bookDetails">
            <div class="bookDetail">
                <label for="validationDefault01">Id</label>
                <input type="text" class="form-control" id="validationDefault01" placeholder="First name" value="Mark" required/>
            </div>
            
            <div class="bookDetail">
                <label for="inputState1">Status</label>
                <select id="inputState1" class="form-control">
                    <option >Choose...</option>
                    <option>...</option>
                </select>
            </div>
            
            
            <div class="bookDetail">
                <div class="label">
                <label for="inputState2">Payment</label>
                </div>
                <select id="inputState2" class="form-control">
                    <option selected>Yes</option>
                    <option>No</option>
                </select>
            </div>
            
            <div class="bookDetail">
                <div class="label">
                <label  for="validationDefault01">Receiver</label>
                </div>
                <input type="text" class="form-control" id="validationDefault01" placeholder="First name"  required/>
            </div>
            
            <div class="bookDetail">
                <label class="label" for="validationDefault01">Mobile</label>
                <input type="text" class="form-control" id="validationDefault01" placeholder="First name"  required/>
            </div>
            
            <div class="bookDetail">
                <label class="label" for="example-datetime-local-input">Date and time</label>
                <input class="form-control" type="datetime-local" id="example-datetime-local-input"/>   
            </div>
            
            <div class="bookDetail">
                <label class="label" for="validationDefault01">Cost</label>
                    <div>
                    <input type="text" class="form-control" id="validationDefault01" placeholder="First name"  required/>
                </div>
            </div>
        </div>
  
</form>
    
      </main>

      

      <style jsx>{`
        .bookingsContainer {
            background-color: #eee;
            height: 100vh;
          }
          @media screen and (max-width: 700px){
            .bookingsContainer{
              padding-left:10px;
            }}

        .bookDetails{
            position:absolute;
            top:2rem;
            left:13rem;
            display:flex;
            justify-content:space-between;
            background-color:white;
            height:180px;
        }  
        .bookDetail{
            padding:10px 10px;
            margin-right:10px;
        }  
        .label{
            border-bottom:1px solid black;
        }
      `}</style>
    </MainLAyout>
  )
}
